  render() { 
    return (
      <Container fluid>
        <Row>
          <Col style= {{ width: '100%'}}><Sidebar style= {{ width: '100%'}} /></Col>
          <Col><TaskViewCol /></Col>
          <Col><TaskViewCol /></Col>
          <Col><TaskViewCol /></Col>
        </Row>
      </Container>
